import React from 'react';
import { motion } from 'framer-motion';

const SubscriptionPlans = () => {
  const pricingPlans = [
    {
      id: 'one-meal',
      title: 'Solo',
      price: 120,
      description: 'One meal daily',
      popular: false,
      mealBoxes: 1,
      accent: '#8B4513' // Brown
    },
    {
      id: 'two-meals',
      title: 'Classic',
      price: 220,
      description: 'Two meals daily',
      popular: true,
      mealBoxes: 2,
      accent: '#DC2626' // Red
    },
    {
      id: 'family-plan',
      title: 'Family',
      price: 440,
      description: 'For two people',
      popular: false,
      mealBoxes: 3,
      accent: '#1F2937' // Dark gray/black
    }
  ];

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      window.scrollTo({
        top: section.offsetTop - 80,
        behavior: 'smooth'
      });
    }
  };

  const formatPrice = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      maximumFractionDigits: 0
    }).format(amount);
  };

  const renderMealBoxes = (count, accentColor) => {
    return (
      <div className="flex justify-center items-center gap-3 mb-8">
        {Array.from({ length: count }, (_, i) => (
          <motion.div
            key={i}
            className="relative"
            initial={{ opacity: 0, scale: 0.8 }}
            whileInView={{ opacity: 1, scale: 1 }}
            viewport={{ once: true }}
            transition={{ duration: 0.4, delay: i * 0.1 }}
            whileHover={{ scale: 1.05, y: -2 }}
          >
            {/* Food container */}
            <div className="w-20 h-16 bg-white rounded-lg shadow-lg border-2 border-gray-200 relative overflow-hidden">
              {/* Container lid */}
              <div className="absolute top-0 left-0 right-0 h-3 bg-gray-100 border-b border-gray-200"></div>

              {/* Food representation */}
              <div className="absolute top-4 left-2 right-2 bottom-2 rounded-md" style={{backgroundColor: accentColor, opacity: 0.1}}>
                {/* Food items */}
                <div className="absolute top-1 left-1 w-3 h-2 rounded-full" style={{backgroundColor: accentColor, opacity: 0.6}}></div>
                <div className="absolute top-1 right-1 w-2 h-2 rounded-full" style={{backgroundColor: accentColor, opacity: 0.4}}></div>
                <div className="absolute bottom-1 left-1 right-1 h-1 rounded-full" style={{backgroundColor: accentColor, opacity: 0.5}}></div>
              </div>

              {/* Brand mark */}
              <div className="absolute bottom-1 right-1 w-2 h-2 rounded-full" style={{backgroundColor: accentColor}}></div>
            </div>
          </motion.div>
        ))}
      </div>
    );
  };

  return (
    <section id="subscription-plans" className="py-0 pb-20 md:pb-28 overflow-hidden section-fade" style={{backgroundColor: '#f9f5f0'}}>
      <div className="container mx-auto px-4 md:px-6">
        <div className="max-w-5xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-8">
          {pricingPlans.map((plan, index) => (
            <motion.div
              key={plan.id}
              className={`relative transition-all duration-300 ${
                plan.popular ? "md:-mt-6 md:mb-6" : ""
              }`}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.6, delay: index * 0.15 }}
              whileHover={{ y: -4, transition: { duration: 0.3 } }}
            >
              {/* Popular badge */}
              {plan.popular && (
                <motion.div 
                  className="absolute -top-4 left-1/2 transform -translate-x-1/2 z-20"
                  initial={{ opacity: 0, y: -10 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  viewport={{ once: true }}
                  transition={{ duration: 0.5, delay: 0.3 }}
                >
                  <div className="bg-red-600 text-white text-xs font-bold px-4 py-2 rounded-sm shadow-lg uppercase tracking-wider">
                    Most Popular
                  </div>
                </motion.div>
              )}

              {/* Main card */}
              <div className="bg-white rounded-sm shadow-2xl overflow-hidden border border-gray-200">
                {/* Header */}
                <div className="bg-white p-8 text-center border-b border-gray-100">
                  <h3 className="text-3xl font-bold text-gray-900 mb-2 tracking-tight">{plan.title}</h3>
                  <p className="text-gray-600 text-sm uppercase tracking-wider mb-6">{plan.description}</p>

                  {/* Meal boxes visualization */}
                  {renderMealBoxes(plan.mealBoxes, plan.accent)}

                  {/* Price */}
                  <div className="mb-4">
                    <div className="text-5xl font-black text-gray-900 mb-1">
                      {formatPrice(plan.price)}
                      <span className="text-lg font-normal text-gray-500">/day</span>
                    </div>
                  </div>

                  {/* Accent line */}
                  <div className="w-16 h-1 mx-auto rounded-full" style={{backgroundColor: plan.accent}}></div>
                </div>

                {/* Content area */}
                <div className="p-8 bg-gray-50">
                  {/* Minimal features */}
                  <div className="space-y-3 mb-8 text-center">
                    <div className="flex items-center justify-center gap-2 text-gray-700">
                      <div className="w-2 h-2 rounded-full bg-gray-400"></div>
                      <span className="text-sm font-medium">Free Delivery</span>
                    </div>

                    <div className="flex items-center justify-center gap-2 text-gray-700">
                      <div className="w-2 h-2 rounded-full bg-gray-400"></div>
                      <span className="text-sm font-medium">Fresh Daily</span>
                    </div>

                    <div className="flex items-center justify-center gap-2 text-gray-700">
                      <div className="w-2 h-2 rounded-full bg-gray-400"></div>
                      <span className="text-sm font-medium">No Commitment</span>
                    </div>
                  </div>

                  {/* CTA Button */}
                  <motion.button
                    onClick={() => scrollToSection('daily-combos')}
                    className="w-full py-4 rounded-sm font-bold text-sm uppercase tracking-wider shadow-lg transition-all border-2"
                    style={{
                      backgroundColor: plan.popular ? plan.accent : 'white',
                      color: plan.popular ? 'white' : plan.accent,
                      borderColor: plan.accent
                    }}
                    whileHover={{ 
                      scale: 1.02,
                      backgroundColor: plan.accent,
                      color: 'white'
                    }}
                    whileTap={{ scale: 0.98 }}
                  >
                    Order Now
                  </motion.button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SubscriptionPlans;
